void seduce_font_lane_init(SeduceRenderFont *font)
{
	SeduceFontCharacter *glyphs;
	RFormats vertex_format_types = R_FLOAT;
	uint i, j, size, largest, pos = 0;
	float *vertex_array, *vertex_section, **ref_sections;
	char *name = "lane";

	for(i = 0; name[i] != 0 && i < 31; i++)
		font->name[i] = name[i];
	font->name[i] = 0;
	i = 2;
	font->pool = r_array_allocate(SEDUCE_LANE_VERTEX_COUNT, &vertex_format_types, &i, 1, SEDUCE_LANE_REFERENCE_COUNT);
	vertex_section = r_array_section_allocate_vertex(font->pool, SEDUCE_LANE_VERTEX_COUNT); 
	r_array_load_vertex(font->pool, vertex_section, seduce_vertex_lane, 0, SEDUCE_LANE_VERTEX_COUNT);
	font->glyphs = glyphs = malloc((sizeof *font->glyphs) * SEDUCE_LANE_GLYPH_COUNT);
	for(i = j = 0; i < SEDUCE_LANE_GLYPH_COUNT; i++)
	{
		glyphs[i].sections = r_array_section_allocate_reference(font->pool, seduce_ref_count_lane[i]);
		r_array_load_reference(font->pool, glyphs[i].sections, vertex_section, &seduce_ref_lane[j], seduce_ref_count_lane[i]);
		j += seduce_ref_count_lane[i];
	}
	for(i = j = 0; i < SEDUCE_LANE_GLYPH_COUNT; i++)
	{
		glyphs[i].size = 0;
		for(j = 0; j < 8; j++)
		{
			glyphs[i].kerning[j] = seduce_kerning_lane[i * 8 + j];
			if(glyphs[i].kerning[j] > glyphs[i].size)
				glyphs[i].size = glyphs[i].kerning[j];
		}
	}
	seduce_font_load_construct_graph(font, seduce_lookup_lane, SEDUCE_LANE_CHARACTER_COUNT);
}
